import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function HomePage() {
    const navigate = useNavigate();

  return (
    <div className="Home">
      <h1>HOME PAGE</h1>
      <button className="btn btn-secondary" onClick={() => navigate("/Sucursales/BusquedaSucursales")}>Sucursales</button>
    </div>
  );
}

export default HomePage;
